import React from 'react'
import './Custom.css'
import Shoenique from '../../Shoenique'
import {Link} from 'react-router-dom'
import shoenw from '../img/shoenw.png'
import { auth, createUserDocument } from '../../components/firebase.js';
import { Component } from 'react'


class Custom2 extends Component {

    logout = () => {
        auth.signOut();
    }

    render(){
        return(

        <>

            <div className="navbar">
                <img src={shoenw} className="logo" />
                <ul>
                    <li className='nav-item'>
                        
                    </li>
                    <li className='nav-item'>
                        
                    </li>
                    <li className='nav-item'>
                        
                    </li>
                    <li className=''>
                        <button onClick={this.logout}>Logout</button>
                    </li>
                </ul> 
            </div>


            < Shoenique />
        
        </>
        )
  
}}
export default Custom2;
